import React from 'react';

const Todo = props => {
  return (
    <div>
      <input style={toDoStyling} onChange={props.changed} type='text' />
      <button style={buttonStyling} onClick={props.submit}>
        Add Task
      </button>
    </div>
  );
};

const toDoStyling = {
  border: '2px solid black',
  borderRadius: '8px'
};
const buttonStyling = {
  marginLeft: '15px',
  borderRadius: '8px'
};

export default Todo;
